import Navbar from '../ComponentsReno/Navbar'
import Header from './Header'

function Media() {
    const [active, setActive] = useState(0)
  return (
    <div>
        <Navbar/>
        <Header active={active} handleActive={(e) => setActive()}/>

    </div>
  )
}

export default Media
